function Automobil(marka, model, godina_proizvodnje, boja, cijena){
  this.marka = marka,
  this.model = model,
  this.godina_proizvodnje = godina_proizvodnje,
  this.boja = boja,
  this.cijena = cijena,

  function azurirajCijenu(novaCijena) {this.cijena = novaCijena;},
  function detalji() {
    console.log(`Ovo je autmoboil {this.marka} {this.model} proizveden {this.godina_proizvodnje godine. Boja je {this.boja} i kosta {this.cijena} eura!`);
  }
}

let audi = new Automobil("Audi", "A5", 2018, "bijela", 20000)
audi.azurirajCijenu(18000);
audi.detalji();
